node.text:
I was so excited to bring my car out to the L’OE Show but life had other plans. Something came up last minute that I had to take care of in Los Angeles and wasn’t able to attend.  Luckily because of this awesome community the car made it and is in the @rotiform store next to the million dollar scirocco. I’m so proud of all of the snaps that are coming on my feed. Mike and his team @eurowise_performance went above and beyond and I think we ended up with something pretty special.  @captainsaveadub @jayceand @kofell @genericmotorsports you guys are the coolest adventure men I know. Thanks for not dumping the car in ABQ. I owe you guys big. @xjamiexoe this looks like a hell of a show! You pulled it off! Thanks for selling me the car in the first place and continuing to be one of my best car friends. And thank you to everyone who sponsored parts or helped out with this thing at all. 

